Cannes = Chaos . Anyone who has been there will agree with me . Well , in all this crazy we also took upon ourselves to curate and execute a full fledged party . This was a first for us and I’d be lying if I said I wasn’t nervous . By the time we decided to go ahead with this , most venues were blocked and gone. After  a lot of back and forth and heartache we managed more than fine . By some miracle and a lot of help from friends , we bagged The Carlton and what a great start to us hosting events in Cannes ! The hotel is iconic and we couldn’t be more pleased . This trusting the process things Is real me thinks . 
Also , thank you for trusting us @hollywoodreporterindia and team @pernodricardindia
@anupama.chopra @missusdesai I love how we stay synced beyond the chaos every year ❤️
